package chpher;

import Decoder.BASE64Decoder;
import Decoder.BASE64Encoder;
import javax.crypto.Cipher;
import javax.crypto.spec.IvParameterSpec;
import javax.crypto.spec.SecretKeySpec;

public class AesKit {
    /* renamed from: IV */
    public static final String f0IV = "mysycmcmcysmcysm";
    public static final String KEY = "mysycmsycmsycmsy";
    private static String hexStr = "0123456789ABCDEF";

    public static void main(String[] args) throws Exception {
        System.out.println(Decrypt(""));
    }

    public static String Encrypt(String sSrc) throws Exception {
        if (sSrc.equals("")) {
            return "";
        }
        String sKey = KEY;
        if (sKey.length() != 16) {
            System.out.print("Key16");
            return null;
        }
        SecretKeySpec skeySpec = new SecretKeySpec(sKey.getBytes(), "AES");
        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(1, skeySpec, new IvParameterSpec(f0IV.getBytes()));
        return new BASE64Encoder().encode(cipher.doFinal(sSrc.getBytes("utf-8")));
    }

    public static String Decrypt(String HexSSrc) throws Exception {
        SecretKeySpec skeySpec = new SecretKeySpec("w28Cz694s63kBYk4".getBytes("utf-8"), "AES");
        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(2, skeySpec, new IvParameterSpec("4kYBk36s496zC82w".getBytes("utf-8")));
        try {
            return new String(cipher.doFinal(hexStringToBytes(HexSSrc)), "utf-8");
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        }
    }

    public static String detrypt(String message) throws Exception {
        if (message.equals("")) {
            return "";
        }
        SecretKeySpec skeySpec = new SecretKeySpec(KEY.getBytes("utf-8"), "AES");
        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(2, skeySpec, new IvParameterSpec(f0IV.getBytes("utf-8")));
        try {
            return new String(cipher.doFinal(new BASE64Decoder().decodeBuffer(message)), "utf-8");
        } catch (Exception e) {
            e.printStackTrace();
            return "";
        }
    }

    public static String detrypt2(String message) throws Exception {
        String sKey = "mmysycmmysycmsyy";
        String IV = "mmmycmcmcysmcysm";
        if (message.equals("")) {
            return "";
        }
        SecretKeySpec skeySpec = new SecretKeySpec(sKey.getBytes("utf-8"), "AES");
        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(2, skeySpec, new IvParameterSpec(IV.getBytes("utf-8")));
        try {
            return new String(cipher.doFinal(new BASE64Decoder().decodeBuffer(message)), "utf-8");
        } catch (Exception e) {
            e.printStackTrace();
            return "";
        }
    }

    public static byte[] HexStringToBinary(String hexString) {
        int len = hexString.length() / 2;
        byte[] bytes = new byte[len];
        for (int i = 0; i < len; i++) {
            bytes[i] = (byte) (((byte) (hexStr.indexOf(hexString.charAt(i * 2)) << 4)) | ((byte) hexStr.indexOf(hexString.charAt((i * 2) + 1))));
        }
        return bytes;
    }

    public static byte[] hexStringToBytes(String hexString) {
        hexString = hexString.toUpperCase();
        int length = hexString.length() / 2;
        char[] hexChars = hexString.toCharArray();
        byte[] b = new byte[length];
        for (int i = 0; i < length; i++) {
            int pos = i * 2;
            b[i] = (byte) ((charToByte(hexChars[pos]) << 4) | charToByte(hexChars[pos + 1]));
        }
        return b;
    }

    private static byte charToByte(char c) {
        return (byte) "0123456789ABCDEF".indexOf(c);
    }
}